import React, { useRef } from 'react';
import { useTranslation } from 'react-i18next';
import './App.css';
import { motion } from 'framer-motion';

export default function App() {
  const { t, i18n } = useTranslation();
  const contactRef = useRef(null);

  const changeLanguage = (e) => {
    i18n.changeLanguage(e.target.value);
  };

  const handleScrollToContact = () => {
    contactRef.current?.scrollIntoView({ behavior: 'smooth' });
  };

  return (
    <div className="app dark-theme">
      <div className="lang-switcher">
        <select onChange={changeLanguage} defaultValue={i18n.language}>
          <option value="uz">UZ</option>
          <option value="en">EN</option>
          <option value="ru">RU</option>
        </select>
      </div>

      <motion.header
        className="hero"
        initial={{ opacity: 0 }}
        animate={{ opacity: 1 }}
        transition={{ duration: 1 }}
      >
        <motion.div
          className="hero-content"
          initial={{ y: -50, opacity: 0 }}
          animate={{ y: 0, opacity: 1 }}
          transition={{ duration: 0.8 }}
        >
          <h1>{t('heroTitle')}</h1>
          <p>{t('heroSubtitle')}</p>
          <motion.button
            className="cta"
            whileHover={{ scale: 1.05 }}
            whileTap={{ scale: 0.95 }}
            onClick={handleScrollToContact}
          >
            {t('startButton')}
          </motion.button>
        </motion.div>
      </motion.header>

      <motion.section
        className="courses"
        initial={{ opacity: 0, y: 30 }}
        whileInView={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.6 }}
      >
        <h2>{t('coursesTitle')}</h2>
        <div className="course-cards">
          {['course1', 'course2', 'course3'].map((course, index) => (
            <motion.div
              key={index}
              className="card"
              whileHover={{ scale: 1.05 }}
              transition={{ type: 'spring', stiffness: 300 }}
            >
              <h3>
                {index === 0
                  ? 'Strength Training'
                  : index === 1
                  ? 'Hypertrophy'
                  : 'Nutrition'}
              </h3>
              <p>{t(course)}</p>
            </motion.div>
          ))}
        </div>
      </motion.section>

      <motion.section
        className="about-trainer"
        initial={{ opacity: 0, x: -50 }}
        whileInView={{ opacity: 1, x: 0 }}
        transition={{ duration: 0.6 }}
      >
        <h2>{t('aboutTrainer')}</h2>
        <img src="/trainer.jpg" alt="Zulfiqor" className="trainer-img" />
        <p>{t('trainerDescription')}</p>
      </motion.section>

      <motion.section
        className="testimonials"
        initial={{ opacity: 0, y: 30 }}
        whileInView={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.6 }}
      >
        <h2>{t('testimonialsTitle')}</h2>
        <div className="testimonial-cards">
          {['feedback1', 'feedback2'].map((feedback, i) => (
            <motion.div
              className="testimonial"
              key={i}
              whileHover={{ scale: 1.03 }}
            >
              <p>‚Äú{t(feedback)}‚Äù</p>
              <span>{i === 0 ? '‚Äì Ali' : '‚Äì Dilshod'}</span>
            </motion.div>
          ))}
        </div>
      </motion.section>

      <motion.section
        className="contact"
        ref={contactRef}
        initial={{ opacity: 0, scale: 0.95 }}
        whileInView={{ opacity: 1, scale: 1 }}
        transition={{ duration: 0.6 }}
      >
        <h2>{t('contactTitle')}</h2>
        <form>
          <input type="text" placeholder={t('name')} required />
          <input type="email" placeholder={t('email')} required />
          <textarea placeholder={t('message')} required></textarea>
          <motion.button
            type="submit"
            whileHover={{ scale: 1.05 }}
            whileTap={{ scale: 0.95 }}
          >
            {t('send')}
          </motion.button>
        </form>
        <div className="social">
          <p>Instagram | Telegram | YouTube</p>
        </div>
      </motion.section>

      <footer>
        <p>{t('footer1')}</p>
        <p>üìç {t('footer2')}</p>
        <p>üìû +998 90 123 45 67 | üì© trener@example.com</p>
        <p>¬© 2025 MuscleMaster. {t('footer3')}</p>
      </footer>
    </div>
  );
}
